function bike(props) {
  const model = "RoyalEnfleid";
  const { bikeinfo, maintain, color } = props; //destructuring
  const { rate, warenty } = bikeinfo; //destructuring
  const text = `Hi,I Am ${color} ${model} ${maintain},Bike_Rate:${rate} & Bike_Warenty:${warenty}`;
  return <h2 style={{color:"dark",backgroundColor:"lightblue"}}>{text}</h2>;
}
export default bike;
